    public class Day21Tests
    {
        [Test]
        public void MonkeyMath_CanInitialise()
        {
            var monkeyMath = new MonkeyMath(_exampleInput);

            monkeyMath.Monkeys["root"].Name.Should().Be("root");
            monkeyMath.Monkeys["root"].Number.Should().Be(null);
            monkeyMath.Monkeys["root"].MonkeyLeft.Should().Be("pppw");
            monkeyMath.Monkeys["root"].Operation.Should().Be('+');
            monkeyMath.Monkeys["root"].MonkeyRight.Should().Be("sjmn");

            monkeyMath.Monkeys["dbpl"].Name.Should().Be("dbpl");
            monkeyMath.Monkeys["dbpl"].Number.Should().Be(5);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForExample1()
        {
            var monkeyMath = new MonkeyMath(_exampleInput);

            monkeyMath.DoShouting();

            monkeyMath.Monkeys["root"].Number.Should().Be(152);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForPart1()
        {
            var monkeyMath = new MonkeyMath(_puzzleInput);

            monkeyMath.DoShouting();

            monkeyMath.Monkeys["root"].Number.Should().Be(87457751482938);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForExample2()
        {
            var monkeyMath = new MonkeyMath(_exampleInput);
            monkeyMath.Monkeys["humn"].Number = null;

            var humnShout = monkeyMath.WhatShouldHumnShout();

            humnShout.Should().Be(301);
        }

        [Test]
        public void Test_ShouldFindThePuzzleAnswerForExample2_checked()
        {
            var monkeyMath = new MonkeyMath(_exampleInput);
            monkeyMath.Monkeys["humn"].Number = 301;

            monkeyMath.DoShouting();

            var left = monkeyMath.Monkeys[monkeyMath.Monkeys["root"].MonkeyLeft].Number;
            var right = monkeyMath.Monkeys[monkeyMath.Monkeys["root"].MonkeyRight].Number;
            left.Should().Be(right);
        }

        //[Test]
